import "./App.css";

import { Navbar, Nav, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

import "./Style.css";

function App() {
  return (
    <header>
      <Navbar>
        <Container>
          <Nav className="Menu">
            <Nav.Link className="px-5" href="#home">
              Home
            </Nav.Link>
            <Nav.Link className="px-5" href="#service">
              Service
            </Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    </header>
  );
}

export default App;
